  return students
    .filter(student => student.location === city)
    .map(student => {
      const matchingGrades = newGrades.filter(grade => grade.studentId === student.id);
      const grade = matchingGrades.length ? matchingGrades[0].grade : 'N/A';
      return { ...student, grade };
    });
}

